import * as fs from 'fs';

export const writeFile = () => {
    let fs = require('fs');
    var obj = { table: [] };
    obj.table.push({ id: 1, square:2 });
    var json = JSON.stringify(obj);
    fs.writeFile('myjsonfile.json', json, 'utf8', function (err) {
        if (err) throw err;
        console.log('Saved!');
    });
};
